import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <>
      <Router>
      <Routes>
      <Route exact path='/'></Route>
      </Routes>
        </Router>    
    </>
  );
}

export default App;
